import React, {useState, useEffect} from 'react';
import { Button } from '@material-ui/core';
import countapi from 'countapi-js';

export default function CounterButton() {
	const [count, setCount] = useState(0);

	useEffect(async () => {
		await countapi.set('1ccb732e-b55a-4404-ad3f-0f99c02fe44e', count);
	})

	return (
		<Button 
          color="primary" 
          variant="outlined"
          onClick={() => {
            countapi.hit('1ccb732e-b55a-4404-ad3f-0f99c02fe44e').then(result => console.log(result.value));
          }}
        >
          Hello world
        </Button>
	);
}
